import React from "react";
import { Link } from "react-router-dom";

const ReadOnly = ({ data, handleEditClick }) => {
  return (
    <tr>
      <td>{data.id}</td>
      <td>{data.name}</td>
      <td>{data.position}</td>
      <td>{data.office}</td>
      <td>{data.office}</td>
      <td>{data.age}</td>

      <td>
        <Link to="#" className="me-3 text-primary">
          <i class="ri-pencil-line"></i>
        </Link>
        <Link to="#" className="text-danger" onClick={deleteEvent}>
          <i class="ri-delete-bin-line"></i>
        </Link>
      </td>
    </tr>
  );
};

export default ReadOnly;
